import React from 'react'
import Data from '../data/data'
import Card from '../card/Card'


const Cards = () => {
  return (
    <div>
        <h1>Food</h1>
        {
            Data.map((item,index)=>{
                return <Card item={item} index={index}/>
            })
        }
    </div>
  )
}

export default Cards
